import RegisterPage from './components/RegisterPage';

function App() {
    return (
        <Router>
            <Routes>
                <Route exact path="/" component={Lan} />
                <Route exact path="/login" component={LoginPage} />
                <Route exact path="/register" component={RegisterPage} />
            </Routes>
        </Router>
    );
}

export default App;
